import React, { useState } from 'react';

const Navbar: React.FC = () => {
  const [isOpen, setIsOpen] = useState(false);

  return (
    <div
  className={`fixed top-0 left-0 w-24 h-24 rounded-br-full transition-all duration-1000 ease-in-out z-10 ${
    isOpen ? 'w-72 h-72' : ''
  }`}
  style={{
    background: isOpen
      ? 'linear-gradient(to right, red, green, blue)'
      : 'black',
  }}
>
      <div className="absolute top-0 left-0 w-12 h-12 rounded-full cursor-pointer bg-white z-20 transition-all duration-1000 ease-in-out"
           onClick={() => setIsOpen(!isOpen)}>
        <div className={`absolute w-6 h-1 bg-black rounded-full top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2 ${isOpen ? 'opacity-0' : ''}`}></div>
        <div className={`absolute w-6 h-1 bg-black rounded-full top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2 ${isOpen ? 'rotate-45' : 'translate-y-[-10px]'}`}></div>
        <div className={`absolute w-6 h-1 bg-black rounded-full top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2 ${isOpen ? 'rotate-[-45deg]' : 'translate-y-[10px]'}`}></div>
      </div>
    </div>
  );
};

export default Navbar;
